module.exports = async d => {
    const code = d.command.code

    const r = code.split("$getObjectProperty[").length - 1

    const inside = code.split("$getObjectProperty[")[r].split("]")[0]

    return {
        code: code.replaceLast(`$getObjectProperty[${inside}]`, d.object ? d.object[inside] || "" : "")
    }
}